import {React, useState} from "react";


export function BasicsApp() {
    const [count, setCont] = useState(0)
    const handleIncrement = () => {
        setCont (
            count + 1
        )
    }
    return (
        <>
            <div className="app">
            <button onClick={handleIncrement} >click here</button>
            {count}
            </div>           
        </> 
    );
}
